import React from "react";

const updateRadar = ({droneData}) => {
    var c = document.getElementById("radarcanvas");
    var ctx = c.getContext("2d");
    ctx.moveTo(0, 125);
    ctx.lineTo(250, 125);
    ctx.stroke(); 
};

const setupRadar = () => {
    var c = document.getElementById("radarcanvas");
    var ctx = c.getContext("2d");
    ctx.clearRect(0, 0, c.width, c.height);
}

export default {
    updateRadar: updateRadar,
    setupRadar: setupRadar
};
